import { fontFamily, fontSize } from "@mui/system";
import React from "react";

function Pension(props) {
  return (
    <div>
      <div
        style={{
          width: "auto",
          textAlign: "center",
          backgroundColor: "#f4f3f4",
          height: "120px",
          margin: "2rem",
          borderRadius: "0.8rem",
          fontFamily: "DungGeunMo",
          fontSize: "2rem"
        }}
      >
        COMING SOON...
      </div>
    </div>
  );
}

export default Pension;
